import React, { useState } from 'react';
import { Card, CardHeader, CardTitle, CardContent } from '@/components/ui/card';
import { Button } from '@/components/ui/button';
import { Alert, AlertDescription } from '@/components/ui/alert';
import { Select, SelectContent, SelectItem, SelectTrigger, SelectValue } from '@/components/ui/select';
import { Input } from '@/components/ui/input';

const TokenAuth = () => {
  const [username, setUsername] = useState('');
  const [team, setTeam] = useState('');
  const [token, setToken] = useState('');
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  // 韩国球队列表
  const teams = [
    '울산', '김천', '수원FC', '포항', '서울', 
    '광주', '제주', '대전', '전북', '대구', 
    '인천', '강원'
  ];

  const getToken = async () => {
    try {
      setLoading(true);
      setError('');

      // 检查输入
      if (!username || !team) {
        throw new Error('请输入用户名并选择球队');
      }

      const response = await fetch(
        `http://220.88.39.23:5000/api/user/token?username=${encodeURIComponent(username)}&team=${encodeURIComponent(team)}`,
        {
          method: 'GET',
        }
      );

      const data = await response.json();

      if (!response.ok) {
        throw new Error(data.msg || '获取token失败');
      }

      if (data.token) {
        setToken(data.token);
        localStorage.setItem('footballToken', data.token);
      } else {
        throw new Error('返回数据中没有token');
      }

    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <Card className="w-full max-w-md mx-auto mt-8">
      <CardHeader>
        <CardTitle>获取访问Token</CardTitle>
      </CardHeader>
      <CardContent className="space-y-4">
        <div className="space-y-2">
          <label className="text-sm font-medium">用户名</label>
          <Input
            type="text"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            placeholder="输入用户名"
          />
        </div>

        <div className="space-y-2">
          <label className="text-sm font-medium">选择球队</label>
          <Select value={team} onValueChange={setTeam}>
            <SelectTrigger>
              <SelectValue placeholder="选择球队" />
            </SelectTrigger>
            <SelectContent>
              {teams.map((teamName) => (
                <SelectItem key={teamName} value={teamName}>
                  {teamName}
                </SelectItem>
              ))}
            </SelectContent>
          </Select>
        </div>

        {error && (
          <Alert variant="destructive">
            <AlertDescription>{error}</AlertDescription>
          </Alert>
        )}

        <Button 
          onClick={getToken} 
          disabled={loading || !username || !team}
          className="w-full"
        >
          {loading ? '获取中...' : '获取Token'}
        </Button>

        {token && (
          <div className="p-2 bg-gray-50 rounded">
            <p className="text-sm font-medium">Token:</p>
            <p className="font-mono text-xs break-all">{token}</p>
          </div>
        )}
      </CardContent>
    </Card>
  );
};

export default TokenAuth;
